import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { List, ListItem, ListItemIcon, ListItemText, Divider, Icon, Typography } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        display: 'inherit',
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
    secondary: {
        display: 'block',
        margin: '10px 0px',
    },
}));

function About() {

    const classes = useStyles();

    return (
        <Fragment>
            <div className="col-4">
                <List component="nav">
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>contacts</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Contact Info" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>school</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Work and Education" />
                    </ListItem> 
                </List>
            </div>
            <div className="col-8">
                <List className={classes.root}>
                    <ListItem>
                        <ListItemText 
                            primary="Education"

                        />
                        <Divider />
                        <Typography className={classes.secondary} component="p" variant="body2" color="primary">
                            Central Piedmont Community College
                        </Typography>
                    </ListItem>
                </List>
            </div>
        </Fragment>
    );
}

export default About;
